import { NavLink } from "react-router-dom"
import './Navbar.css'
import {BsCurrencyBitcoin} from 'react-icons/bs'

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="logo">
        <BsCurrencyBitcoin className="logo-icon"/>
      </div>





    </nav>
  )
}

export default Navbar
